  - name: TEXT4000
    number: '6'
    value: 'AMENDMENT DESCRIPTION: Report is being amended in response to Letter of
      Inquiry dated 1/7/09. We have correctly reported the 2 different names for the
      contributions originally reported from Leon Benjamin. They are now reported
      as Leon Benjamin III and Leon Benjamin, Jr. The receipt of $55,116.70 from Lincoln
      & Mario Diaz-Balart Florida as reported on Schedule A supporting Line 15 represents
      an offset of expenditures reported on Schedule B supporting Line 21(b). These
      expenditures relate to the Joint Fundraising Committee Lincoln & Mario Diaz-Balart
      Florida. All expenses and reimbursements occurred in the month of June 2008
      and are reported on this report. The expenses paid by the Committee and reimbursed
      by the JFC are reported on Line 21(b) as follows: $1,500.00 for valet service,
      $3,471.50 for restroom service, $445.20 for Golf Cart service, $9,450.00 for
      catering, $250 for printing and $40,000.00 for travel. All transfers from Affiliated/Other
      Party Committees are appropriately recorded as such on Schedule A supporting
      line 12. All payments on Schedule H4 supporting Line 21(a) for audio/video,
      audio/visual, were for generic use of the Committee. None of these expenditures
      were for a communication that referred to a clearly identified candidate for
      Federal office or that promoted, supported, attacked or opposed any such candidate
      for Federal office. The negative disbursement from the John McCain 2008 represents
      a reimbursement of expenses for use of copy machine, cleaning and cable expense
      utilized by representatives of the John McCain campaign. These operating expenses
      of the Committee were all paid by the Committee as administrative allocated
      activity, and therefore the reimbursement is recorded as such. We have clarified
      the description for merchant discount and administrative fees. The year-to-date
      amount of $2,492,085.32 is correct as of 6/30/08 for the administrative category
      on Schedule H4. We have clarified the description for event tickets reported
      on Schedule H4.   All disbursements for salaries and benefits disclosed on Schedule
      H4 are for employees who did not spend more than 25% of their compensated time
      during the reporting period on Federal election activities or activities in
      connection with a Federal election. The Committee uses the Escrow option for
      receipt of corporate in-kind donations as provided for by the Commission in
      Advisory Opinion 1992-33. The method ensures that prohibited sources are not
      used to fund the federal share of allocable activity expenses. In-kind details
      and the escrow account activity are summarized as follows:   Administrative
      Escrow account and In-kinds:  5/31/08 balance in Administrative escrow account
      of $8,679.34.  6/20/08 Transfer from Admin escrow to MD-08 escrow of $4,000
      as reflected on Sch H4.   6/30/08 balance in Administrative escrow account of
      $4,679.34.  MD-08 Escrow account and In-kinds:  5/31/08 balance in MD-08 escrow
      account is $6,008.48  6/1/08 PRA Aviation in-kind of $420.00 as reflected on
      Sch H4 and transfer on Sch H3 using $33.60 of escrow balance.  6/1/08 Premier
      A1 Holdings in-kind of $1,415.60 as reflected on Sch H4 and transfer on Sch
      H3 using $113.25 of escrow balance.  6/5/08 Scott Holdings LLC in-kind of $2,537.72
      as reflected on Sch H4 and transfer on Sch H3 using $203.02 of escrow balance.  6/12/08
      Crystal Beach Development in-kind of $4,934.00 as reflected on Sch H4 and transfer
      on Sch H3 using $394.72 of escrow balance.  '
